import React, { useState, useEffect } from "react";
import UserLogin from "./UserLogin";
import UserSignin from "./UserSignin";


function UserEntry(props) {

    const [accExis, setAccExis] = useState(false);

    const accExistQue = (val) => {
        setAccExis(() => val);
    }

    return (<>
        <div className="container-fluid">
            {accExis ?
                <UserLogin accExistQue={accExistQue} changeLoginState={props.changeLoginState} />
                :
                <UserSignin accExistQue={accExistQue} changeLoginState={props.changeLoginState} />
            }
        </div>
    </>);
}

export default UserEntry;
